import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate, useLocation } from 'react-router-dom';
import Landing from './pages_old/Landing';
import Marketing from './pages_old/Marketing';
import HowTheyWork from './pages_old/HowTheyWork';
import MeetOurAgents from './pages_old/MeetOurAgents';
import AgentDetail from './pages_old/AgentDetail';
import About from './pages_old/About';
import Pricing from './pages_old/Pricing';
import Calendar from './pages_old/Calendar';
import Dashboard from './pages_old/Dashboard';
import Analytics from './pages_old/Analytics';
import Training from './pages_old/Training';
import Insights from './pages_old/Insights';
import Chat from './pages_old/Chat';
import SignIn from './pages_old/SignIn';
import CompanyAgentDetail from './pages_old/CompanyAgents/CompanyAgentDetail';
import ConversationsTab from './components/agent/tabs/ConversationsTab';
import TrainingTab from './components/agent/tabs/TrainingTab';
import PerformanceTab from './components/agent/tabs/PerformanceTab';
import SettingsTab from './components/agent/tabs/SettingsTab';
import HelpWidget from './components/chat/HelpWidget';
import Header from './components/Header';
import Footer from './components/Footer';
import './index.css';

// Auth check
const isAuthenticated = () => {
  return localStorage.getItem('isAuthenticated') === 'true';
};

// Protected Route component
const ProtectedRoute = ({ children }: { children: React.ReactNode }) => {
  if (!isAuthenticated()) {
    return <Navigate to="/signin" />;
  }
  return <>{children}</>;
};

// ScrollToTop component to handle scroll on route changes
function ScrollToTop() {
  const location = useLocation();

  React.useEffect(() => {
    window.scrollTo({ top: 0, behavior: 'smooth' });
  }, [location]);

  return null;
}

// AppContent component to use hooks
function AppContent() {
  return (
    <div className="min-h-screen flex flex-col">
      <Header />
      <main className="flex-grow">
        <Routes>
          {/* Public Routes */}
          <Route path="/" element={<Landing />} />
          <Route path="/marketing" element={<Marketing />} />
          <Route path="/how-they-work" element={<HowTheyWork />} />
          <Route path="/meet-our-agents" element={<MeetOurAgents />} />
          <Route path="/agent/:agentId" element={<AgentDetail />} />
          <Route path="/about" element={<About />} />
          <Route path="/pricing" element={<Pricing />} />
          <Route path="/signin" element={<SignIn />} />

          {/* Protected Routes */}
          <Route path="/calendar" element={<ProtectedRoute><Calendar /></ProtectedRoute>} />
          <Route path="/dashboard" element={<ProtectedRoute><Dashboard /></ProtectedRoute>} />
          <Route path="/analytics" element={<ProtectedRoute><Analytics /></ProtectedRoute>} />
          <Route path="/training" element={<ProtectedRoute><Training /></ProtectedRoute>} />
          <Route path="/insights" element={<ProtectedRoute><Insights /></ProtectedRoute>} />
          <Route path="/chat" element={<ProtectedRoute><Chat /></ProtectedRoute>} />

          {/* Company Agent Routes */}
          <Route path="/company-agents/:agentId" element={<ProtectedRoute><CompanyAgentDetail /></ProtectedRoute>}>
            <Route path="conversations" element={<ConversationsTab />} />
            <Route path="training" element={<TrainingTab />} />
            <Route path="performance" element={<PerformanceTab />} />
            <Route path="settings" element={<SettingsTab />} />
          </Route>
        </Routes>
      </main>
      <Footer />
      <HelpWidget />
    </div>
  );
}

// Main App component
function App() {
  return (
    <Router>
      <ScrollToTop />
      <AppContent />
    </Router>
  );
}

export default App;
